import LZString from 'lz-string'

export const decompress = (data: string) =>
  /* eslint-disable-next-line @typescript-eslint/no-non-null-assertion */
  JSON.parse(LZString.decompressFromBase64(data)!) as string[]

const PRESET_LISTS = {
  Quordle: decompress(
    '',
  ),
  Octordle: decompress(
    '',
  ),
  "Don't Wordle": decompress(
    '',
  ),
  'LeMot (Louan)': decompress(
    '',
  ),
  'LeMot (Solitaire-Play)': decompress(
    '',
  ),
  'LeMot6 (Solitaire-Play)': decompress(
    '',
  ),
} as const

export type PresetList = keyof typeof PRESET_LISTS

export default PRESET_LISTS
